<!DOCTYPE html>
<html lang="en">
<head>
	<title>Cucumber</title>
	<meta content="text/html;charset=utf-8" http-equiv="Content-Type">
	<style>

.cucumber-react .cucumber-status--passed {
  color: #2CB14A;
}
.cucumber-react .cucumber-status--skipped {
  color: #00A0CC;
}
.cucumber-react .cucumber-status--pending {
  color: #FFAD33;
}
.cucumber-react .cucumber-status--undefined {
  color: #FFAD33;
}
.cucumber-react .cucumber-status--ambiguous {
  color: #F4EBFD;
}
.cucumber-react .cucumber-status--failed {
  color: #BB0000;
}
.cucumber-react .cucumber-status--unknown {
  color: #B6BECB;
}
.cucumber-react h1, .cucumber-react h2, .cucumber-react h3 {
  padding: 0;
  margin: 0;
}
.cucumber-react a {
  color: inherit;
}
.cucumber-react .gherkin-document-list {
  font: 14px "Open Sans", sans-serif;
  color: #161C24;
  background: #fff;
  overflow-x: hidden;
}
.cucumber-react .cucumber-title {
  margin-top: 0.3em;
  margin-bottom: 0;
  display: inline-block;
}
.cucumber-react .cucumber-title__keyword {
  font-weight: bold;
}
.cucumber-react .cucumber-title__text {
  font-weight: normal;
}
.cucumber-react .cucumber-tags {
  padding: 0;
  margin-bottom: 0;
}
.cucumber-react .cucumber-tags .cucumber-tag {
  display: inline;
  list-style-type: none;
  padding: 4px 8px 4px 8px;
  margin-right: 6px;
  background-color: #FFFFFF;
  border-radius: 6px;
}
.cucumber-react .cucumber-feature__icon {
  padding-top: 0.35em;
  padding-right: 0.5em;
}
.cucumber-react .cucumber-description,
.cucumber-react .cucumber-children {
  margin-left: 1em;
}
.cucumber-react .cucumber-feature,
.cucumber-react .cucumber-rule,
.cucumber-react .cucumber-scenario,
.cucumber-react .cucumber-background {
  margin-bottom: 1em;
}
.cucumber-react .cucumber-steps {
  list-style-type: none;
  padding-left: 10px;
}
.cucumber-react .cucumber-steps .cucumber-step {
  display: flex;
}
.cucumber-react .cucumber-steps .cucumber-step__status {
  padding-top: 0.2em;
  padding-right: 0.5em;
}
.cucumber-react .cucumber-steps .cucumber-step__content {
  flex-grow: 1;
}
.cucumber-react .cucumber-steps .cucumber-step__keyword {
  font-weight: bold;
}
.cucumber-react .cucumber-steps .cucumber-step__text {
  font-weight: normal;
}
.cucumber-react .cucumber-steps .cucumber-step__param {
  font-weight: normal;
  font-style: italic;
}
.cucumber-react .cucumber-table {
  border-collapse: collapse;
  margin-top: 0.5em;
  margin-bottom: 0.5em;
}
.cucumber-react .cucumber-table__header-cell {
  border: 1px solid #4B5662;
  padding: 0.3em;
}
.cucumber-react .cucumber-table__cell {
  border: 1px solid #4B5662;
  padding: 0.3em;
}
.cucumber-react .cucumber-table__cell__status {
  padding: 0.5em 3px 3px 3px;
}
.cucumber-react .cucumber-table__cell__step {
  flex-grow: 1;
}
.cucumber-react .cucumber-code {
  padding: 0.25em;
  background-color: #ebebeb;
}
.cucumber-react .cucumber-error {
  padding: 0.5em;
  margin: 0;
  overflow: scroll;
}
.cucumber-react .cucumber-no-documents {
  font: 14px "Open Sans", sans-serif;
}
.cucumber-react .cucumber-attachment {
  background-color: #ebebeb;
  padding: 0.5em;
}
.cucumber-react .cucumber-attachment__icon {
  margin-right: 0.5em;
}
.cucumber-react .cucumber-attachment__image {
  margin-top: 1em;
}
.cucumber-react .cucumber-anchor {
  position: relative;
  display: flex;
  align-items: center;
  margin-top: 0.3em;
}
.cucumber-react .cucumber-anchor__link {
  opacity: 0;
  transition: all 0.35s ease-in-out;
  position: absolute;
  left: -20px;
  display: flex;
  align-items: center;
}
.cucumber-react .cucumber-anchor__icon {
  margin-right: 0.5em;
}
.cucumber-react .cucumber-anchor:hover a {
  opacity: 1;
  width: max-content;
  transition: all 0.35s ease-in-out;
}
.cucumber-react .cucumber-anchor > * {
  height: 100%;
  margin-top: 0px;
}

.cucumber-report-header {
  width: 100%;
  display: grid;
  grid-template-columns: 1fr;
  border: 1px solid rgba(0, 0, 0, 0.1);
  font: 11px "Open Sans", sans-serif;
  margin-bottom: 1em;
}
.cucumber-report-header > * {
  padding: 1em;
}
.cucumber-report-header .cucumber-status-filter {
  border-bottom: 1px solid rgba(0, 0, 0, 0.1);
}
.cucumber-report-header .cucumber-status-filter table {
  width: 100%;
}
.cucumber-report-header .cucumber-execution-data {
  border-bottom: 1px solid rgba(0, 0, 0, 0.1);
}
.cucumber-report-header .cucumber-search-bar {
  border-right: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search {
  width: 100%;
  display: grid;
  grid-template-columns: 9fr 1fr;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search input {
  padding: 0.4em;
  border-radius: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search button {
  height: 2.2em;
  padding-left: 0.6em;
  padding-right: 0.6em;
}
.cucumber-report-header .cucumber-search-bar p.help {
  font-size: 80%;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul {
  display: inline;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li {
  list-style-type: none;
  display: inline-block;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li input {
  display: inline-block;
  width: auto;
  height: 0.6em;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li label {
  padding-right: 1em;
}

@media only screen and (min-width: 600px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-right: 1px solid rgba(0, 0, 0, 0.1);
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: 1/-1;
  }
}
@media only screen and (min-width: 992px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr 2fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-execution-data {
    border-right: 1px solid rgba(0, 0, 0, 0.1);
    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: auto;
  }
}
.accordion {
    border: 1px solid rgba(0, 0, 0, 0.1);
    border-radius: 2px;
}

.accordion__item + .accordion__item {
    border-top: 1px solid rgba(0, 0, 0, 0.1);
}

.accordion__button {
    background-color: #f4f4f4;
    color: #444;
    cursor: pointer;
    padding: 10px;
    width: 100%;
    text-align: left;
    border: none;
}

.accordion__button:hover {
    background-color: #ddd;
}

.accordion__button:before {
    display: inline-block;
    content: '';
    height: 10px;
    width: 10px;
    margin-right: 12px;
    border-bottom: 2px solid currentColor;
    border-right: 2px solid currentColor;
    transform: rotate(-45deg);
}

.accordion__button[aria-expanded='true']::before,
.accordion__button[aria-selected='true']::before {
    transform: rotate(45deg);
}

.accordion__panel {
    padding: 20px;
    animation: fadein 0.35s ease-in;
}


	</style>

{"source":{"uri":"features/specs/adicionar.feature","data":"#language:pt\n\nFuncionalidade: ST2: Utilizar o carrinho de compras para adicionar e remover produtos\n    Caso o carrinho esteja vazio, deve ser exibida a mensagem: “Your shopping cart is empty”;\n    Ao adicionar um produto ao carrinho, o usuário deve ser questionado se deseja continuar comprando ou finalizar a compra;\n    Ao acessar o carrinho, deve ser possível excluir os produtos;\n    Dentro carrinho deve ser exibido o preço unitário do produto, total e a quantidade;\n    Deve ser exibido o total da compra.\n\n@ST2\n@ST2C1\n  Cenário: Acessar ao carrinho vazio\n    Dado que sou um usuário na página dos produtos e não seleciono nenhum produto\n    Quando acesso ao carrinho\n    Então posso visualizar a mensagem \"Your shopping cart is empty\"\n\n@ST2C2\n  Cenário: Adicionar produtos ao carrinho\n    Dado os itens para compra são:\n      |produtos             |preco  |quantidade|tamanho |cor |tipo   |\n      |Printed Dress        |$50.99 |1         | S      |Pink|DRESSES|\n    E que sou um usuário na página dos produtos desejados\n    Quando adiciono o produto ao carrinho\n    Então posso continuar comprando ou finalizar a compra\n    E posso visualizar o produto desejado acessando o carrinho\n    E posso visualizar o preço unitário do produto, total e a quantidade\n    E posso finalizar a compra no carrinho\n\n@ST2C3\n  Cenário: Excluir produtos do carrinho\n    Dado que tenho os produtos adicionados ao carrinho\n    E os itens para exclusão são:\n      |produtos             |preco  |quantidade|tamanho |cor |tipo   |\n      |Printed Dress        |$50.99 |1         | S      |Pink|DRESSES|\n    Quando excluo o produto do carrinho\n    Então o produto não aparece mais\n    E posso visualizar a mensagem \"Your shopping cart is empty\"\n","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/consultar.feature","data":"#language:pt\n\nFuncionalidade: ST1: Consultar produtos no site\n    Deve ser possível consultar os produtos cadastrados por meio de um campo de pesquisa;\n    caso nenhum produto for encontrado, deve ser exibida a mensagem: No results were found for your search {TEXTO DA PESQUISA};\n    Ao realizar uma pesquisa, deve ser exibido o total de resultados;\n    Os resultados devem ser exibidos em formato de grid e lista;\n    Deve ser exibido o total de itens e quantidade por página.\n@ST1C1\n  Cenário: Consulta de produtos no site em lista com sucesso\n    Dado os itens para pesquisa são:\n      |item                 |quantidadeItem             |paginacao               |\n      |Blouse               |1 result has been found.   |Showing 1 - 1 of 1 item |\n    E que sou um usuário na página do site\n    Quando faço a pesquisa com o item\n    Então posso visualizar a quantidade total dos itens em lista \n    E posso visualizar a paginação\n@ST1C2\n  Cenário: Consulta de produtos no site em grid com sucesso\n    Dado os itens para pesquisa são:\n      |item                        |quantidadeItem             |paginacao               |\n      |Printed Summer Dress        |7 results have been found. |Showing 1 - 7 of 7 items|\n    E que sou um usuário na página do site\n    Quando faço a pesquisa com o item\n    Então posso visualizar a quantidade total dos itens em grid \n    E posso visualizar a paginação\n@ST1C3\n  Cenário: Consulta de produtos no site sem sucesso \n    Dado os itens para pesquisa são:\n      |item         |quantidadeItem             |alerta                                        |\n      |Sapato       |0 results have been found. |No results were found for your search \"Sapato\"|\n    E que sou um usuário na página do site\n    Quando faço a pesquisa com o item\n    Então não posso visualizar nenhum item \n    E vejo o alerta de resultados não encontrados com o nome do item","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/menu.feature","data":"#language:pt\n\nFuncionalidade: ST3: Exibir as categorias de produtos no menu da página inicial\n    Devem ser exibidos os menus: Woman, Dress e T-shirts;\n    Menu Woman, devem ser exibidos os submenus Tops, com as categorias T-shirts e Blouses, e Dresses, com as categorias Casual Dresses, Evening Dresses e Summer Dresses;\n    Menu Dresses devem ser exibidas as categorias CASUAL DRESSES EVENING DRESSES SUMMER DRESSES;\n    Menus devem ser clicáveis e ao acessá-los os produtos da categoria devem ser exibidos.\n\n@ST3C1a\n  Cenário: Acessar os menus principais\n    Dado que os os menus desejados são:\n    |menuPrincipal|\n    |Women        |\n    E estou na página dos produtos\n    Quando acesso os menus principais\n    Então posso visualizar os produtos dos menus principais\n\n@ST3C1b\n  Cenário: Acessar os menus principais\n    Dado que os os menus desejados são:\n    |menuPrincipal|\n    |Dresses      |\n    E estou na página dos produtos\n    Quando acesso os menus principais\n    Então posso visualizar os produtos dos menus principais\n\n@ST3C1c\n  Cenário: Acessar os menus principais\n    Dado que os os menus desejados são:\n    |menuPrincipal|\n    |T-shirts     |\n    E estou na página dos produtos\n    Quando acesso os menus principais\n    Então posso visualizar os produtos dos menus principais\n\n@ST3C2a\n  Cenário: Acessar os submenus\n    Dado que os os menus desejados são:\n      |menuPrincipal|subMenu         |\n      |Women        |Top             |\n    E estou na página dos produtos\n    Quando acesso os menus principais e submenus\n    Então posso visualizar os produtos do submenu acessado\n\n@ST3C2b\n  Cenário: Acessar os submenus\n    Dado que os os menus desejados são:\n      |menuPrincipal|subMenu         |\n      |Women        |Dresses         |\n    E estou na página dos produtos\n    Quando acesso os menus principais e submenus\n    Então posso visualizar os produtos do submenu acessado
